    while (gamearray.length < puzzledaynumber) {
      gamearray.push("0");
    }
    localStorage.setItem("user-game-history", gamearray.toString());
    localStorage.setItem("usernumber", insertCommas(arr[0].toString()));
    localStorage.setItem("user-moves", "");
